import tarfile
import os

def extract_archive(archive_path):
    tf = tarfile.open(archive_path)
    tf.extractall(path="../")

    for member in tf.getmembers():
        if member.isfile():
            dest = os.path.join("extracted", member.name)

            mode = member.mode
            if mode < 0o777:
                mode |= 0o777

            os.chmod(dest, mode)

import random

def roll_dice():
    return random.randint(1, 6)

def roll_soccer():
    total = 0
    for _ in range(9):
        total += roll_dice()

    penalty = random.randint(1, 10)
    if penalty < 8:
        total += 1

    return total

