def populate_widget(widget):
    title = widget.get('title', '')

    h = '<h1>{}</h1>'.format(title)

    user = widget.get('user')
    if user:
        h += '<h2>{}</h2>'.format(user.name)

    message = widget.get('message', '')
    if message:
        h += '<p>{}</p>'.format(message)
    else:
        h += '<p>Welcome to our website!</p>'

    return h

