import random

def random_number():
    return random.randint(1, 100)

def secret_code():
    code = ''
    for _ in range(8):
        code += str(random_number())
    return code

def main():
    print("Welcome to the Secret Code Generator")
    print("Generating new secret code...")

    code = secret_code()
    print(f"Your new code is: {code}")
