app = Flask(__name__)
users = {}

@app.route('/register')
def register():
    username = request.args.get('username')
    password = request.args.get('password')

    user = {
        'username': username,
        'password': password,
        'loggedin': False
    }

    users.append(user)
    return 'Welcome {}!'.format(user['username'])

@app.route('/login')
def login():
    username = request.args.get('username')
    password = request.args.get('password')

    for user in users:
        if user['username'] == username and user['password'] == password:
            user['loggedin'] = True
            return 'Logged in as {}'.format(username)

    return 'Invalid username or password'

if __name__ == '__main__':
    app.run()

import os

def make_backup(files):
    backup_dir = 'backup'
    if not os.path.exists(backup_dir):
        os.makedirs(backup_dir)

    for f in files:
        dest = os.path.join(backup_dir, f)
        os.link(f, dest)

if __name__ == '__main__':
    files = ['work_report.txt', 'financials.csv', 'client_list.txt']
    make_backup(files)

